							logger.error('DEBUG::'+scriptName+' typeof(inRaceElement['+i+'])= '+typeof(inRaceElement)+' inRaceElement['+i+']= '+inRaceElement+' length= '+inRaceElement.length+' strObservation= '+strObservation+' length= '+strObservation.legnth+' EVAL: strObservation.indexOf(inRaceElement)= '+strObservation.indexOf(inRaceElement));
						}
						if(strObservation.indexOf(inRaceElement)<0) {
							// 2022-08-22 JER - If not found or not provided then leave Race blank
							// 2022-07-27 JER - Modified to accommodate outRace as Object()
							// outRace[inRaceElement]= '';

							// 2022-08-22 JER - Added the values to an array to evaluate after the for arrObservations loop
							outString= inRaceElement+':N';
							arrRace.push(outString);
						} else {
							// 2022-08-22 JER - Added the values to an array to evaluate after the for arrObservations loop
							// outRace[inRaceElement]= 'Y';
							outString= inRaceElement+':Y';
							arrRace.push(outString);
							// 2022-08-22 JER - If any race observation is found then foundRace boolean is true
							foundRace= true;
						} // end if
					} // end for

				} else {
					// 2022-07-27 JER - Verify this modified code to handle if there is no current Medical Condition value has no length
					var lstRaceElements= inRace.toString().split(',');
					for(var i= 0;i<lstRaceElements.length;i++) {
						var inRaceElement= lstRaceElements[i].toString();
						if(debug>0) { 
							logger.error('DEBUG::'+scriptName+' Defined with value - typeof(inRaceElement['+i+'])= '+typeof(inRaceElement)+' inRaceElement['+i+']= '+inRaceElement+' length= '+inRaceElement.length);
						}
						// 2022-07-27 JER - Modified to accommodate outRace as Object()
						// 2022-08-22 JER - If not found or not provided then leave Race blank
						// outRace[inRaceElement]= '';
						outString= inRaceElement+':N';
						arrRace.push(outString);
					} // end for
				} // end if

				// 2022-08-22 JER - evaluate the foundRace if no value is true then set observations value= '' no value (i.e. unknown)
				if(foundRace== false) {
					for each(element in arrRace) {
						var lstElements= element.toString().split(':');
						var inRaceElement= lstElements[0];
						outRace[inRaceElement]= '';
					} // end for each
				} else {
					for each(element in arrRace) {
						var lstElements= element.toString().split(':');
						var inRaceElement= lstElements[0];
						outRace[inRaceElement]= lstElements[1];
					} // end for each
				} // end if 				
			} // end for
			channelMap.put('outRace',outRace);
		} else {
			// 2022-07-27 JER - Verify this modified code to handle if there is no current Medical Condition value has no length
			var lstRaceElements= inRace.toString().split(',');
			for(var i= 0;i<lstRaceElements.length;i++) {
				var inRaceElement= lstRaceElements[i].toString();
				if(debug>0) { 
					logger.error('DEBUG::'+scriptName+' Defined with no value - typeof(inRaceElement['+i+'])= '+typeof(inRaceElement)+' inRaceElement['+i+']= '+inRaceElement+' length= '+inRaceElement.length);
				}
				// 2022-08-22 JER - If not found or not provided then leave Race blank
				// 2022-07-27 JER - Modified to accommodate outRace as Object()
				outRace[inRaceElement]= '';
			} // end for
		}
		channelMap.put('outRace',outRace);
	} // end if
	if(debug>0) { 
		logger.error('DEBUG::'+scriptName+' typeof(outRace)= '+typeof(outRace)+' toString= '+outRace.toString()+' length= '+outRace.toString().length); 
	}
} // end function

